const prices = ({ bpi }) => {
  const [state, setState] = useState({
    currency: "USD"
  });

  return (
    <div>
      <ul className="listgroup">
        {bpi.map((each, i) => {
          console.log(each, i);
        })}
      </ul>
    </div>
  );
};

export default prices;
